import Link from 'next/link';
import withLayout from '../components/MyLayoutAtribute.js';

const Page = () => <p>Hello Next.js</p>;

const PostLink = props => (
    <li>
        <Link href={`/post?title=${props.title}`}>
            <a>{props.title}</a>
        </Link>
    </li>
);

export default withLayout(Page);
